    18,nt"tags": [],nt"title": "Partial pressure (or fugacity) of carbon dioxide,
    salinity and other variables collected from Surface underway observations using
    Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer and other instruments
    from RIO BLANCO in the English Channel, Mediterranean Sea and others from 2009-12-13
    to 2010-12-14 (NODC Accession 0117291)",nt"tracking_summary": {ntt"total":
    4,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-03-07T21:34:41.654116",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surf5f9e0",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0117291 includes Surface
    underway data collected from RIO BLANCO in the English Channel, Mediterranean Sea,
    North Atlantic Ocean, South Atlantic Ocean and Strait of Gibraltar from 2009-12-13
    to 2010-12-14. These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity)
    of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide
    - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these
    data include Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer, Shower
    head chamber equilibrator for autonomous carbon dioxide (CO2) measurement and thermosalinographs.nnThese
    data were collected by Nathalie Lefevre of Universite Pierre et Marie Curie; Institut
    Pierre Simon Laplace; Laboratoire D'Oceanographie et du Climat: Experimentations
    et Approches Numeriques as part of the VOS_Rio_Blanco_2010 data set. CDIAC associated
    the following cruise ID(s) with this data set: 06RB20091213nnThe Global Volunteer
    Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
